const axios = require('axios')


const getUserLocation = () => {

    return axios.get("https://geolocation-db.com/json/8dd79c70-0801-11ec-a29f-e381a788c2c0")
            .then((res) => {
                return res.then((data) =>
                    console.log(data)
                )
            })

}

module.exports = { getUserLocation }
